import React from 'react'
import { OCCUPIED } from '../shared/constants'

const Bomb = (props) => {
  return (
    <img src="/explode.gif" className="tile" onClick={() => {props.onClick(props.row, props.col, OCCUPIED)}} />
  )
}

export default Bomb
